import React, { Fragment } from 'react';

import FilmsListItem from '../FilmsListItem';

const FilmsList = ({films}) => {
    return (
        <Fragment>
            <h1>Films List</h1>
            <ul class="list-group">
                <li class="list-group-item">
                    {
                        films.map(film => <FilmsListItem film={film} />)
                    }
                </li>
            </ul>
        </Fragment>
    )
};

export default FilmsList;
